  true,\n\t\"url\": null,\n\t\"notes\": \"The Jeanne Clery Disclosure of Campus Security
  Policy and Campus Crime Statistics Act is a federal statute requiring colleges and
  universities participating in federal financial aid programs to maintain and disclose
  campus crime statistics and security information. The U.S. Department of Education
  conducts reviews to evaluate an institution's compliance with the Clery Act requirements.
  A review may be initiated when a complaint is received, a media event raises certain
  concerns, the school's independent audit identifies serious noncompliance, or through
  a review selection process that may also coincide with state reviews performed by
  the FBI's Criminal Justice Information Service (CJIS) Audit Unit. Once a review
  is completed, the Department issues a Final Program Review Determination. Although
  regular program reviews may contain Clery Act findings, this page includes only
  those program reviews that were focused exclusively on the Clery Act.\",\n\t\"license_title\":
